int Poll(void)
{
register int a,b,c,d,ret,go=1;

#ifdef TRACE_IT
TrBu[TrBuPtr]='L';if(++TrBuPtr>=TRACE_BUFFER_LENGTH) TrBuPtr=0;
#endif

	if(IBCP>=IBS)
	{
#ifdef TRACE_IT
TrBu[TrBuPtr]='l';if(++TrBuPtr>=TRACE_BUFFER_LENGTH) TrBuPtr=0;
TrBu[TrBuPtr]='1';if(++TrBuPtr>=TRACE_BUFFER_LENGTH) TrBuPtr=0;
#endif
		return(0);
	}
	if((ret=read(Port,IB+IBCP,(IBS-IBCP)))<1)
	{
#ifdef TRACE_IT
TrBu[TrBuPtr]='l';if(++TrBuPtr>=TRACE_BUFFER_LENGTH) TrBuPtr=0;
TrBu[TrBuPtr]='2';if(++TrBuPtr>=TRACE_BUFFER_LENGTH) TrBuPtr=0;
#endif
		return(0);
	}
	IBCP+=ret;

#ifdef COMM_DEBUG
printf("STS");fflush(stdout);
#endif

	while(go)
	{
		a=IBCP;
		for(b=0;b<a;b++)
		{
			if((IB[b]==13)||(IB[b]==7))	// Terminator
			{

#ifdef COMM_DEBUG
printf("\nT = %d/%d '%c': ",b,IBCP,IB[0]);fflush(stdout);
#endif

				switch(IB[0])	// 0 is OK, because we tidy up the buffer as we go...
				{
					case 'V' :	// version
						for(c=0;c<4;c++) Version[c]=IB[c+1];
#ifdef COMM_DEBUG
printf("Version Recognized");fflush(stdout);
#endif
					break;
					case 'N' :
						for(c=0;c<4;c++) Serial[c]=IB[c+1];
					break;
					case 'F' :	// Status
						if(IB[1]>='A')
							StatusFlag=(IB[1]-'A')+10;
						else
							StatusFlag=(IB[1]-'0');
						StatusFlag<<=4;
						if(IB[2]>='A')
							StatusFlag+=(IB[2]-'A')+10;
						else
							StatusFlag+=(IB[2]-'0');
						CRSignal=1;
					break;
					case 'z' :	// transmission ack
					case 'Z' :
#ifdef COMM_DEBUG
printf("Transmission Success");fflush(stdout);
#endif
						CRSignal=1;
					break;
					case 't' :	// 11 bit frame ( 3 byte ID )
						IC_MessageID=0;IC_MessageLength=0;
						for(c=1;c<4;c++)
						{
							IC_MessageID<<=4;
							if(IB[c]>='A')
								IC_MessageID+=(IB[c]-'A')+10;
							else
								IC_MessageID+=(IB[c]-'0');
						}
						if((IB[4]>='0')&&(IB[4]<='8'))
						{
							IC_MessageLength=(IB[4]-'0');
#ifdef COMM_DEBUG
printf("A");fflush(stdout);
#endif
							AnalyseFrame(5);
#ifdef COMM_DEBUG
printf("a");fflush(stdout);
#endif
						}
						else
						{
							IC_MessageLength=-1;
#ifdef COMM_DEBUG
							printf("\n###ERROR : Message length is %d:'%c'",IB[4],IB[4]);fflush(stdout);
#endif
						}
						CRSignal=1;
					break;
					case 'T' :	// 29 bit frame ( 8 byte ID )
						IC_MessageID=0;IC_MessageLength=0;
						for(c=1;c<8;c++)
						{
							IC_MessageID<<=4;
							if(IB[c]>='A')
								IC_MessageID+=(IB[c]-'A')+10;
							else
								IC_MessageID+=(IB[c]-'0');
						}

						if((IB[8]>='0')&&(IB[8]<='8'))
						{
							IC_MessageLength=(IB[8]-'0');
							AnalyseFrame(9);
						}
						else
						{
							IC_MessageLength=-1;
#ifdef COMM_DEBUG
							printf("\n###ERROR : Message length is %d:'%c'",IB[8],IB[8]);fflush(stdout);
#endif
						}
						CRSignal=1;
					break;
					case 13 :
						CRSignal=1;
					break;
					case 7 :
#ifdef COMM_DEBUG
printf("\n*****  ERROR BELL RECEIVED...");fflush(stdout);
#endif
						CRSignal=1;
					break;
					default :
#ifdef COMM_DEBUG
printf("Header Byte : '%c' ",IB[0]);fflush(stdout);
for(c=0;c<b;c++) printf("'%c'",IB[c]);
fflush(stdout);
#endif
					break;
				}
		// Tidy up...
				if(IBCP==(b+1))	// This is the only message, so no copy req.
					IBCP=0;
				else
				{
					a=b+1;		// from here
					c=IBCP-b;	// this many
#ifdef COMM_DEBUG
printf(" => %d/%d : ",a,c);fflush(stdout);
#endif
					for(d=0;d<c;d++)
					{
						IB[d]=IB[d+a];
					}
					IBCP-=(b+1);
#ifdef COMM_DEBUG
printf(" -> %d",IBCP);fflush(stdout);
#endif
				}
				b=a+2;	// quit from loop in 'C' fashion...
			}
		}
		if(b==a) go=0;
	}

#ifdef COMM_DEBUG
printf("RET");fflush(stdout);
#endif

#ifdef TRACE_IT
TrBu[TrBuPtr]='l';if(++TrBuPtr>=TRACE_BUFFER_LENGTH) TrBuPtr=0;
#endif
return(ret);
}



int ReadRawMopedFile(void)
{
FILE		*fp;
register int	a,b,c;

	if((fp=fopen(PIC_FILE_NAME,"r"))==NULL)
	{
		return(0);
	}
	fseek(fp,5L,SEEK_SET);
	for(b=0;b<HEIGHT;b++)
	{
		c=b*WIDTH;
		for(a=0;a<WIDTH;a++)
		{
			ImageBuffer[c].R=(unsigned char)fgetc(fp);
			ImageBuffer[c].G=(unsigned char)fgetc(fp);
			ImageBuffer[c].B=(unsigned char)fgetc(fp);
			++c;
		}
	}
	fclose(fp);
}

void SS_Stats(void)
{
int	a,b,c;
float	MPG,ThrottleV,SpeedV;


	for(b=0;b<80;b++)
	{
		c=b*WIDTH;
		for(a=0;a<(WIDTH-6);a++)
		{
			ImageBuffer[c].R=0;
			ImageBuffer[c].G=0;
			ImageBuffer[c].B=0;
			++c;
		}
	}

	if(AccRpm!=0.0f)
		MPG=(float)(((AccSpd*SPDSCALER_MILE)/AccRpm));
	else
		MPG=0.0f;

	sprintf(Message,"%2.1f MPG",MPG);			// Accumulated MPG on this trip
	c=GetMyStringLength(Message,0,2);
	PutMyString(Message,(WIDTH-8-c),42,0,2);
	b=c;

	if(MPG>0.0f)
		ThrottleV=((((AccSpd*(float)TimeElapsed)/(float)AccSpdCntr)/5760.0f)/MPG);	// This many gallons were used on this trip
	else
		ThrottleV=0.0f;
	sprintf(Message,"%1.3f Gal",ThrottleV);
	c=GetMyStringLength(Message,0,2);
	PutMyString(Message,(WIDTH-b-c-26),42,0,2);

	sprintf(Message,"- TRIP -",ThrottleV);
	c=GetMyStringLength(Message,0,2);
	PutMyString(Message,(WIDTH-b-c-46),18,0,2);

	ThrottleV=((MeasuredKMPG*0.625f*MeasurementKilometers)+(MPG*DistanceTravelled))/(MeasurementKilometers+DistanceTravelled);
	sprintf(Message,"All : %d Mq%2.1f W",(int)(((MeasurementKilometers+DistanceTravelled)*0.625f)+0.5f),ThrottleV);
	c=GetMyStringLength(Message,0,2);	// 321 is the center
	PutMyString(Message,30,30,0,2);

	ThrottleV=((float)AccSpd/(float)AccSpdCntr)*0.625f;		// Average Trip Speed
	sprintf(Message,"%2.1f MPH",ThrottleV);
	c=GetMyStringLength(Message,0,2);
	PutMyString(Message,(WIDTH-10-c),18,0,2);

	a=(int)((float)TimeElapsed/60.0f);		// minute
	b=TimeElapsed-(a*60);				// seconds
	if(a>=60)
	{
		c=(int)((float)a/60.0f);	// hour
		a-=(c*60);
		sprintf(Message,"%1d:%02d:%02d",c,a,b);
	}
	else
		sprintf(Message,"%02d:%02d",a,b);
	PutMyString(Message,286,18,0,2);

	MPG=(AccSpd*(float)TimeElapsed)/(float)AccSpdCntr;
	DistanceTravelled=MPG/3600.0f;		// Since we computed /s updates -> /h

	sprintf(Message,"%1.1f Miles",(DistanceTravelled*0.625f));
	PutMyString(Message,286,42,0,2);

	CopyDisplayBufferToScreen(0,0,(WIDTH-6),80);

}

void ScreenSaver(void)
{
int	a,b,c,tx,ty;

	if(--ScrSv_NumberOfTimes<1)
	{
		ReadRawMopedFile();
		SS_Stats();
		ScrSv_NumberOfTimes=300;
	}

	tx=(int)(((float)(rand()&0xFFF0)*16)/(float)0xFFFF);	// 0-15
	ty=(int)(((float)(rand()&0xFFF0)*10)/(float)0xFFFF)+2;	// 0-11
	if((tx*=40)>600) tx=600;				// to further slow down processing...
	if((ty*=40)>440) ty=440;

	for(b=ty;b<(ty+40);b++)
	{
		c=tx+b*WIDTH;
		for(a=0;a<40;a++)
		{
			ImageBuffer[c].R=(unsigned char)0;
			ImageBuffer[c].G=(unsigned char)0;
			ImageBuffer[c].B=(unsigned char)0;
			++c;
		}
	}
	CopyDisplayBufferToScreen(0,0,WIDTH,HEIGHT);
}

