void TransferFont(int fsx, int fsy, int tx, int ty, int fw, int fh,int zoom)
{
register unsigned char	*FRPtr;			// current row's string ptr
register int	ch;
register int	cr=fsy,tr=fsy+fh;	// current / target row
register int	cc,sc=fsx,tc=fsx+fw;	// current / start / target column
register int	cp,sz1,sz2;			// colour pointer
register int	WBPtr,WBpy=ty,cv;	// Pointer to workbuffer
register unsigned char	Rv,Gv,Bv;

#ifdef TRACE_IT
TrBu[TrBuPtr]='F';if(++TrBuPtr>=TRACE_BUFFER_LENGTH) TrBuPtr=0;
#endif


#if 0
	if(WBpy<0)					// don't copy if out of screen (y<0)
	{
printf("\nty<0 for %d:%d fsx=%d fsy=%d wi=%d he=%d zoom=%d",tx,ty,fsx,fsy,fw,fh,zoom);fflush(stdout);
		cr-=WBpy;WBpy=0;
	}
	if(tx<0)
	{
printf("\ntx<0 for %d:%d fsx=%d fsy=%d wi=%d he=%d zoom=%d",tx,ty,fsx,fsy,fw,fh,zoom);fflush(stdout);
		sc=fsx-tx;tx=0;
	}
	if((WBpy+(fh*zoom))>=HEIGHT)			// don't copy if out of screen (y>width)
	{
printf("\nty+h>480 for %d:%d fsx=%d fsy=%d wi=%d he=%d zoom=%d",tx,ty,fsx,fsy,fw,fh,zoom);fflush(stdout);
		tr=fsy+(HEIGHT-WBpy);
	}
	if((tx+(fw*zoom))>=WIDTH)
	{
printf("\ntx+w>640 for %d:%d fsx=%d fsy=%d wi=%d he=%d zoom=%d",tx,ty,fsx,fsy,fw,fh,zoom);fflush(stdout);
		tc-=(tx+(fw*zoom)-WIDTH);
	}
#endif

	while(cr<tr)	// raw...
	{
		FRPtr=Font_Map[cr];		// ptr to string within font map...
		for(cc=sc;cc<tc;cc++)	// column
		{
			ch=(int)(FRPtr[cc]);	// This now contains the intensity value
			for(sz2=0;sz2<zoom;sz2++)
			{
				WBPtr=(tx+((cc-sc)*zoom)+(WBpy+sz2)*WIDTH);
				for(sz1=0;sz1<zoom;sz1++)
				{
					if(WBPtr>=0)
					{
#ifdef FIXED_FONT_COLOR
						Rv=(unsigned char)ImageBuffer[WBPtr].R;
						Gv=(unsigned char)ImageBuffer[WBPtr].G;
						Bv=(unsigned char)ImageBuffer[WBPtr].B;
						if(((Rv<<1)+(Gv<<3)+Bv)<THRESHOLD)	// DARK BACKGROUND
						{
							Rv=(unsigned char)((((int)Rv*(255-ch))+((int)255*ch))>>8);
							Gv=(unsigned char)((((int)Gv*(255-ch))+((int)255*ch))>>8);
							Bv=(unsigned char)((((int)Bv*(255-ch))+((int)255*ch))>>8);
						}
						else
						{
							Rv=(unsigned char)(((int)Rv*(255-ch))>>8);
							Gv=(unsigned char)(((int)Gv*(255-ch))>>8);
							Bv=(unsigned char)(((int)Bv*(255-ch))>>8);
						}
#else
						Rv=(unsigned char)ABS((int)ImageBuffer[WBPtr].R-ch);
						Gv=(unsigned char)ABS((int)ImageBuffer[WBPtr].G-ch);
						Bv=(unsigned char)ABS((int)ImageBuffer[WBPtr].B-ch);
#endif
						ImageBuffer[WBPtr].R=Rv;
						ImageBuffer[WBPtr].G=Gv;
						ImageBuffer[WBPtr].B=Bv;
					}
				++WBPtr;
				}
			}
		}
		WBpy+=zoom;
		cr++;
	}
#ifdef TRACE_IT
TrBu[TrBuPtr]='f';if(++TrBuPtr>=TRACE_BUFFER_LENGTH) TrBuPtr=0;
#endif

}

void PutMyString(char *Text,int x, int y, int usebignums, int zoom)
{
int	a=0,b,px=x,notfound;

#ifdef TRACE_IT
TrBu[TrBuPtr]='S';if(++TrBuPtr>=TRACE_BUFFER_LENGTH) TrBuPtr=0;
#endif

	while(Text[a]!='\0')
	{
		notfound=1;
		if(usebignums)
		{
			b=0;
			while((bignumbers[b].letter!=Text[a])&&(bignumbers[b].x>=0)) ++b;
			if(bignumbers[b].x>=0)
			{
				TransferFont(bignumbers[b].x,bignumbers[b].y,px,y-2,bignumbers[b].width,bignumbers[b].height,zoom);
				px+=bignumbers[b].width*zoom;
				notfound=0;
			}
		}
		if(notfound)
		{
			b=0;
			while((fonts[b].letter!=Text[a])&&(fonts[b].x>=0)) ++b;
			if(fonts[b].x>=0)
			{
				if((fonts[b].letter>='0')&&(fonts[b].letter<='9'))
					TransferFont(fonts[b].x,fonts[b].y,px,y-1,fonts[b].width,fonts[b].height,zoom);
				else
				{
					if(fonts[b].letter=='%')
					{
						if(!usebignums)
							TransferFont(fonts[b].x,fonts[b].y,px,y-2,fonts[b].width,fonts[b].height,zoom);
						else
							TransferFont(fonts[b].x,fonts[b].y,px,y+4,fonts[b].width,fonts[b].height,zoom);
					}
					else
						TransferFont(fonts[b].x,fonts[b].y,px,y+(usebignums*9),fonts[b].width,fonts[b].height,zoom);
				}
				px+=fonts[b].width*zoom;
			}
		}
		++a;
	}
#ifdef TRACE_IT
TrBu[TrBuPtr]='s';if(++TrBuPtr>=TRACE_BUFFER_LENGTH) TrBuPtr=0;
#endif
}

