void MarkDoors(unsigned char Door)
{
register int	a,b,c,xofs,yofs,ptr,xs,xe;
unsigned char	cv,hp;
unsigned char	*RedBuffer;

        switch(Door)
        {
		case 1 :      // Driver
			RedBuffer=SideFrontDoor;
			xofs=100;yofs=0;hp=1;
		break;
		case 2 :      // Passenger
			RedBuffer=SideFrontDoor;
			xofs=100;yofs=0;hp=2;
		break;
		case 3 :      // Rear
			RedBuffer=RearDoors;
			xofs=0;yofs=22;hp=3;
		break;
		default :
			return;
		break;
	}
                                                                                                                
	ptr=0;xe=-1;
	for(b=0;b<108;b++)					// 480-216=264 => 132   
	{
		c=101+((b+132)*WIDTH);
		if((hp&1)&&(ptr>=0)&&(b>=yofs))
		{
			if(RedBuffer[ptr]==0)
			{
				ptr=-1;
				xe=-1;
			}
			else
			{
				xs=xofs+(int)RedBuffer[ptr++];
				xe=xofs+(int)RedBuffer[ptr++];
			}
		}
		for(a=0;a<439;a++)
		{
			if((a>=xs)&&(a<=xe))
			{
				ImageBuffer[c].G=0;
				ImageBuffer[c].B=0;
			}
			++c;
		}
	}

	ptr=0;xe=-1;
	for(b=0;b<108;b++)					// 480-216=264 => 132   
	{
		c=101+(((107-b)+240)*WIDTH);
		if((hp&2)&&(ptr>=0)&&(b>=yofs))
		{
			if(RedBuffer[ptr]==0)
			{
				ptr=-1;
				xe=-1;
			}
			else
			{
				xs=xofs+(int)RedBuffer[ptr++];
				xe=xofs+(int)RedBuffer[ptr++];
			}
		}
		for(a=0;a<439;a++)
		{
			if((a>=xs)&&(a<=xe))
			{
				ImageBuffer[c].G=0;
				ImageBuffer[c].B=0;
			}
			++c;
		}
	}
}

